import { Component } from 'react';
import logo from '../images/logo.svg';
import './App.css';

class App extends Component {
    constructor() {
      super();
      this.state = {
        name: {firstName: "Shaun", lastName: "Roecker"},
        company: "UPCR"
      };

    }

    nameStateChange = () => {
      this.setState({name: 
                      {firstName: "Andrei",
                       lastName: "Nagouie"
                      }
                    });
    };

    render(){
      const { name, company } = this.state;
      return (
        <div className="App">
          <header className="App-header">

            <img src={logo} className="App-logo" alt="logo" />

            <h2>{`Hi I'm ${name.firstName} ${name.lastName}, 
                  I work at ${company}`}</h2>

            <button onClick={this.nameStateChange}>
              {`Change ${name.firstName}`}
            </button>
          </header>
        </div>
      );
    }
}
export default App;
